import './App.css';

import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import LoginRegistration from './Componants/Login/LoginRegistration';
import Registration from './Componants/Login/Registration';
import Home from './Componants/Home';
import About from './Componants/About';

import React from 'react';

function App() {
  // let match = useMatch();
  return (

      <Router>
        <Home />
        <Routes>
          <Route path="/" elements={<Home />} />
          <Route path="/About" elements={<About />} />
          <Route path="/Login" elements={<LoginRegistration />} />
          <Route path="/Registration" elements={<Registration />} />
        </Routes>

      </Router >



  );
}

export default App;
